    "def forward_with_(model, X, ):\n",
    "    idx = 0\n",
    "    out = X\n",
    "    for module in model.netz:\n",
    "        if isinstance(module, nn.Linear):\n",
    "            W = [idx]\n",
    "            bias = [idx + 1]\n",
    "            out = out @ W.T + bias\n",
    "            idx += 2\n",
    "        else:\n",
    "            out = module(out)\n",
    "    return out\n",
    "\n",
